
/*Table structure for table `base_country_area` */

CREATE TABLE `base_country_area` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT ' ',
  `arealevel` int(11) DEFAULT NULL COMMENT ' ',
  `validate_code` varchar(60) DEFAULT NULL COMMENT '身份证号码头部，六位到省市区，不足的补0',
  `parent_id` int(11) DEFAULT NULL COMMENT ' ',
  `name` varchar(30) DEFAULT NULL COMMENT ' ',
  `date_insert` datetime DEFAULT NULL COMMENT ' ',
  `date_update` datetime DEFAULT NULL COMMENT ' ',
  `user_insert` int(11) DEFAULT NULL COMMENT ' ',
  `user_changed` int(11) DEFAULT NULL COMMENT ' ',
  `delete_mark` int(1) DEFAULT '0' COMMENT ' ',
  `is_parent` int(11) DEFAULT NULL COMMENT ' ',
  `py` varchar(100) DEFAULT NULL COMMENT ' ',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `FK_Base_Country_Area_Reference_Base_Country_Area` (`parent_id`) USING BTREE,
  KEY `ID` (`id`,`arealevel`,`name`) USING BTREE,
  KEY `ID_4` (`id`,`name`) USING BTREE

) ENGINE=InnoDB DEFAULT CHARSET=utf8;

